                    ] \n1783年独立战争结束，英国承认13个殖民地独立。1787年通过美国宪法，成立联邦制国家。1861年—1865年，美国爆发了南北战争。亚伯拉罕·林肯领导北方的自由州战胜了南方的蓄奴州。美国从此结束了“半奴隶半自由的状态”，开始全面实行自由资本主义，走上了快速发展的道路。1803年—1959年间，通过购 
